import React, { useState } from 'react';
import './App.css';


function predict(text) {
  setPrediction('yeetTest')
}

function App() {
  const [prediction, setPrediction] = useState(null);

  return (
    <div>
      <nav>
        <a href="/FAQ">FAQ</a>
        <a href="https://github.com/LBlend/mann-eller-kvinne">GitHub</a>
      </nav>
      <div className="full-page-container">
        <h1>Mann eller Kvinne?</h1>
        <p>Skriv og la maskinen gjette om du er mann eller kvinne</p>
        <textarea></textarea>
        <input type="submit" value="Gjett" onSubmit={setPrediction}></input>
        <p>Maskinen gjetter: {prediction}</p>
        <p>Resultat</p>
      </div>
      <footer>
        <p>Laget av <a href="https://lblend.moe">LBlend</a></p>
        <a href="https://github.com/LBlend/mann-eller-kvinne">Kildekode</a>
      </footer>
    </div>
  );
}

export default App;
